import img1 from '../images/service1.jpg';
import img2 from '../images/service2.jpg';
import img3 from '../images/service3.jpg';

const Services = () =>[
    {
       name : 'Web Development',
       img:'img1',
       btn:'Web Development'
    }, 
    {
       name : 'App Development',
       img:'img2',
       btn:'App Development'
    } ,
    {
       name : 'Reapairing',
       img:'img3',
       btn:'Repair'
    } 
    
    
];

export default Services;
